port_model_scheme: |
  ┌------------------------------------------------------------------------┐
  |                         97 entry unified scheduler                     |
  └------------------------------------------------------------------------┘
     0 |       1 |      2 |     3 |     4 |      5 |        6 |       7 |
       ▼         ▼        ▼       ▼       ▼        ▼          ▼         ▼
   ┌-------┐ ┌-------┐ ┌-----┐ ┌-----┐ ┌-----┐ ┌-------┐ ┌--------┐  ┌-----┐
   |  ALU  | |  ALU  | |  LD | |  LD | |  ST | |  ALU  | |  ALU & |  | AGU |
   └-------┘ └-------┘ └-----┘ └-----┘ └-----┘ └-------┘ |  Shift |  └-----┘
   ┌-------┐ ┌-------┐ ┌-----┐ ┌-----┐         ┌-------┐ └--------┘
   |  2ND  | |  Fast | | AGU | | AGU |         |  Fast | ┌--------┐
   | BRANCH| |  LEA  | └-----┘ └-----┘         |  LEA  | | BRANCH |
   └-------┘ └-------┘                         └-------┘ └--------┘
   ┌-------┐ ┌-------┐                         ┌-------┐
   |AVX DIV| |AVX FMA|                         |  AVX  |
   └-------┘ └-------┘                         |  SHUF |
   ┌-------┐ ┌-------┐                         └-------┘
   |AVX FMA| |AVX MUL|                         ┌-------┐
   └-------┘ └-------┘                         |AVX-512|
   ┌-------┐ ┌-------┐                         |  FMA  |
   |AVX MUL| |AVX ADD|                         └-------┘
   └-------┘ └-------┘                         ┌-------┐
   ┌-------┐ ┌-------┐                         |AVX-512|
   |AVX ADD| |AVX ALU|                         |  ADD  |
   └-------┘ └-------┘                         └-------┘
   ┌-------┐ ┌-------┐                         ┌-------┐
   |AVX ALU| |  AVX  |                         |AVX-512|
   └-------┘ | Shift |                         |  MUL  |
   ┌-------┐ └-------┘                         └-------┘
   |  AVX  | ┌-------┐                         ┌-------┐
   | Shift | |  Slow |                         |AVX-512|
   └-------┘ |  LEA  |                         |  ALU  |
             └-------┘                         └-------┘
